input = ""

#input = "dabAcCaCBAcCcaDA"

def react(polymer, i):
  next_letter = int(i)
  for letter in polymer:
    try:
      if letter.islower():
        if polymer[next_letter] == letter.upper():
          polymer = polymer[:next_letter-1] + polymer[next_letter+1:]
          return(polymer)

      else:
        if polymer[next_letter] == letter.lower():
          polymer = polymer[:next_letter-1] + polymer[next_letter+1:]
          return(polymer)
    except IndexError:
      return(1)

    next_letter += 1

units = set(input.lower())
length = int(-1)

set_len = float(len(units))
iterator = int(1)
for unit in units:
  print("progress: %.2f" % (iterator/set_len))
  new_input = input.replace(unit, '').replace(unit.upper(), '')
  flag = 1
  while(flag):
    new_input = react(new_input, 1)
    flag = isinstance(react(new_input, 1), basestring)
  if length == int(-1) or length > len(new_input):
    length = len(new_input)

  iterator += 1

print(length)
